import React from 'react'


import FirstPart from './FirstPart.jsx'
import Navbar from './Navbar.jsx';
import SecondPart from './SecondPart';
import ThirdPart from './ThirdPart';
import Footer from './Footer';

import GalleryFirstPart from './GalleryFirstPart';
import GallerySecondPart from './GallerySecondPart';

import AboutFirstPart from './AboutFirstPart';
import AboutTitle from './AboutTitle';
import AboutSecondPart from './AboutSecondPart';
import AboutThirdPart from './AboutThirdPart';
import AboutFourthPart from './AboutFourthPart';
import AboutFifthPart from './AboutFifthPart.jsx';

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function App(){

    return (
        <div>

            {/* <Navbar />
            <FirstPart />
            <SecondPart />
            <ThirdPart />
            <Footer />; */}

            <Router>

                <div className="full-site">
                    <div className="navbar">

                        <div className="navbar-item">
                            <Link to="/">INICIO</Link>
                        </div>
                        <div className="navbar-item">
                            <Link to="/experiencia">MI EXPERIENCIA</Link>
                        </div>
                        <div className="navbar-item">
                            <Link to="/viaja">VIAJA</Link>
                        </div>
                        <div className="navbar-item"></div>

                        <div className="navbar-item">
                            <img src={process.env.PUBLIC_URL + '/images/logoNoText.png'} alt="logo" />
                        </div>

                        <div className="navbar-item"></div>

                        <div className="navbar-item">
                            <Link to="/galeria">GALERIA</Link>
                        </div>

                        <div className="navbar-item">
                            <Link to="/servicios">SERVICIOS</Link>
                        </div>

                        <div className="navbar-item">
                            <Link to="/contacto">CONTACTO</Link>
                        </div>
                    </div>

                    <Switch>
                        <Route exact path="/">
                            <Inicio />
                        </Route>
                        <Route path="/galeria">
                            <Galeria />
                        </Route>
                        <Route path="/servicios">
                            <Servicios />
                        </Route>
                        </Switch>
                </div>
            </Router>
        </div>
    );
}

function Inicio() {
    return (
        <div>
            <FirstPart />
            <SecondPart />
            <ThirdPart />
            <Footer />;
        </div>
    );
  }

  function Galeria() {
    return (
        <div>
            <GalleryFirstPart />
            <GallerySecondPart />
            <Footer />
        </div>
    );     
  }

  function Servicios() {
    return (
        <div>
            <AboutFirstPart />
            <AboutTitle title1="EXPERIENCES " title2="leave memories"/>
            <AboutSecondPart />
            <AboutTitle title1="MEMORIES " title2="last forever"/>
            <AboutThirdPart />
            <AboutFourthPart />
            <AboutFifthPart />
            <Footer />  
        </div>
    );
  }


export default App
